import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './estilos-menu/landingPage.css'
import Class1 from '../Img/hero-banner.png'
import Class2 from '../Img/about-banner.png'

const LandingPage = () => {
    return (
        // <div className="container">
        //     <div className="background">
        //         <div className="bg-image" style={{ backgroundImage: `url(${Class2})` }}></div>
        //         <div className="bg-image" style={{ backgroundImage: `url(${Class1})` }}></div>
        //     </div>
            
        //     <div className="palabras">
        //         <p>¿Deseas mejorar tus habilidades o adquirir nuevos conocimientos?</p>
        //         <p>Nuestro servicio conecta estudiantes con expertos apasionados.</p>
        //     </div>

        //     <div className="button-container">
        //         <Link to="/home">
        //             <button><h1>Ir al menu</h1></button>
        //         </Link>
        //     </div>
        // </div>

        <>
            <section className="hero">
                <div className="container">

                    <figure className="hero-banner">
                        <img src={Class1} alt="A young lady sits, holding a pen and a notebook."/>
                    </figure>

                    <div className="hero-content">
                        <h1 className="h1 hero-title">Start Your Future Education</h1>
                        <p className="section-text">
                            Credibly redefine distinctive total linkage vis-a-vis multifunction data. 
                            Phosphorescently impact goal-oriented strategic
                        </p>
                        <Link to="/home">
                            <button className="btn btn-primary">Discover More</button>
                        </Link>
                    </div>
                </div>
            </section>

            <section className="about">
                <div className="container">

                    <figure className="about-banner">
                        <img src={Class2} alt="Eduland students" className="about-img" />
                        <button className="play-btn">
                            <ion-icon name="play"></ion-icon>
                        </button>
                    </figure>

                    <div className="about-content">
                        <h2 className="h2 about-title">We Help to Create Possibility & Success in Your Career!</h2>
                        <p className="section-text">
                            Continually administrate process-centric human capital rather than bleeding-edge methodologies.
                            Distinctively supply accurate methods of empowerment before.
                        </p>
                        <Link to="/home">
                            <button className="btn btn-primary">Get Started Today</button>
                        </Link>
                    </div>
                </div>
            </section>
        </>








    );
}

export default LandingPage;
